export default function MyProp() {
  return (
    <>
      <h1>Your plant,</h1>
      <div className="container">
      <img 
      className={img}
      src={plant} alt="Logo" 
      />
      </div>
      {/* style={{width:'25%', height:"28"}} */}
      <p>Tempertature</p>
      {/* 
      <p>Sunlight</p>
      <p>Soil pH</p>
      <p>Moisture</p>
      <p>Humidity</p>
      <p>Ventilation</p>
      */}
      <Footer />
    </>
  );
}
